    <div className="social_wrapper">
      <div>
        <main>
          <Timeline
            dataSource={{
              sourceType: "profile",
              screenName: "PolymathNYC",
            }}
            options={{
              height: "500",
            }}
          />
        </main>
      </div>
      <div>
        note goes here
      </div>
    </div>
  );
}

export default TwitterTimeline;
